$_MODULE['<{braintreeofficial}prestashop>migrationstepone_1c1a9f1cb1e2fa0f77892cb098f0100e'] = 'Recomendamos encarecidamente que habilite el modo de \"mantenimiento\" antes de comenzar el proceso de migración (el proceso de importar la configuración de Braintree no puede tomar más de 10 minutos).';
$_MODULE['<{braintreeofficial}prestashop>migrationstepone_eb2b85bb6aac6a4eb8b26187c105c502'] = '¿Qué sucede con los pedidos procesados anteriormente?';
$_MODULE['<{braintreeofficial}prestashop>migrationstepone_12f6f2e04d46baac609bdbf01c74fac0'] = 'Nosotros migraremos todos los datos para que cada pedido realizado a través de la solución de pago Braintree en el módulo PayPal estén conectados al nuevo módulo Braintree. No se requieren mas acciones una vez que se complete la migración. Simplemente puede administrar sus pedidos como de costumbre.';
